// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Marketplace {
    struct Product {
        uint256 id;
        uint256 price;
        address seller;
        bool isAvailable;
    }

    enum OrderStatus { Pending, Paid, Confirmed, Shipped, Delivered, Cancelled }

    struct Order {
        address buyer;
        uint256 productId;
        OrderStatus status;
        uint256 deadline;
    }

    // State
    Product[] public products;
    mapping(uint256 => Product) public productById;
    mapping(uint256 => Order) public orders;
    mapping(uint256 => uint256) private orderPayments;
    uint256 private orderNonce;

    // Events
    event OrderCreated(uint256 indexed orderId, address indexed buyer, uint256 indexed productId, uint256 amount);
    event OrderStatusUpdated(uint256 indexed orderId, OrderStatus newStatus);

    // Add product
    function addProduct(uint256 price) external {
        uint256 productId = products.length;
        products.push(Product({
            id: productId,
            price: price,
            seller: msg.sender,
            isAvailable: true
        }));
        productById[productId] = products[productId];
    }

    // Create order (payable)
    function createOrder(uint256 productId) external payable {
        Product storage product = productById[productId];
        require(product.isAvailable, "Not available");
        require(msg.value == product.price, "Incorrect payment");

        uint256 orderId = uint256(keccak256(abi.encode(msg.sender, productId, orderNonce++)));
        orders[orderId] = Order({
            buyer: msg.sender,
            productId: productId,
            status: OrderStatus.Paid,
            deadline: block.timestamp + 1 hours
        });
        orderPayments[orderId] = msg.value;
        product.isAvailable = false;

        emit OrderCreated(orderId, msg.sender, productId, msg.value);
    }

    // Update order status
    function updateOrderStatus(uint256 orderId, OrderStatus newStatus) external {
        Order storage order = orders[orderId];
        Product storage product = productById[order.productId];

        require(
            msg.sender == order.buyer || msg.sender == product.seller,
            "Unauthorized"
        );
        require(block.timestamp <= order.deadline, "Expired");
        require(_isValidTransition(order.status, newStatus), "Invalid transition");

        if (newStatus == OrderStatus.Cancelled) {
            product.isAvailable = true;
            payable(order.buyer).transfer(orderPayments[orderId]);
        }

        order.status = newStatus;
        emit OrderStatusUpdated(orderId, newStatus);
    }

    // Validate status transitions
    function _isValidTransition(OrderStatus current, OrderStatus newStatus) private pure returns (bool) {
        return
            (current == OrderStatus.Pending && newStatus == OrderStatus.Paid) ||
            (current == OrderStatus.Paid && (newStatus == OrderStatus.Confirmed || newStatus == OrderStatus.Cancelled)) ||
            (current == OrderStatus.Confirmed && newStatus == OrderStatus.Shipped) ||
            (current == OrderStatus.Shipped && newStatus == OrderStatus.Delivered);
    }
}

